import React from "react";
import { Link, Route, Routes } from "react-router-dom";
import Registration_BusinessPage from "./Registration_BusinessPage";


export const Registration_Page = () => {

    return <React.Fragment>

        <Routes>
        <Route
        path='/'
        element= {
            <React.Fragment>
                <div>Register</div>
                <Link to='business'><div>B</div></Link>
                <div>R</div>

            </React.Fragment>
        }
        />

        <Route
        path="/business"
        element= {<Registration_BusinessPage/>}
        />

        </Routes>
        


    </React.Fragment>

}

export default Registration_Page
